script: |
  super -f text -I q4931.spq | sort > q4931.out

inputs:
  - name: q4931.spq
    data: |
      SELECT ALL + 19 FROM tab0 (FORMAT parquet) AS cor0 WHERE + ( col0 ) NOT IN ( - col1 * - col1 + + CAST ( - 95 AS REAL ), - col1 ) OR ( NULL ) >= NULL;
  - name: tab0

outputs:
  - name: q4931.out
    data: |
      19
      19
      19
